#include <stdio.h>
#include <stdlib.h>

#define MAXN 100005

int n, k;
int a[MAXN];

int cmp(const void *x, const void *y) {
    return (*(int *)x - *(int *)y);
}

int main() {
    scanf("%d %d", &n, &k);
    for (int i = 0; i < n; i++) {
        scanf("%d", &a[i]);
    }
    qsort(a, n, sizeof(int), cmp);
    int cnt = 0;
    for (int i = 0; i < n; i++) {
        if (a[i] != a[i - 1]) {
            for (int j = i - 1; j >= 0 && a[j] > a[j + 1]; j--) {
                int temp = a[j];
                a[j] = a[j + 1];
                a[j + 1] = temp;
                cnt++;
                if (cnt == k) {
                    break;
                }
            }
        }
    }
    qsort(a, n, sizeof(int), cmp);
    for (int i = 0; i < n; i++) {
        printf("%d\n", a[i]);
    }
    return 0;
}
